def select_word(input, bits):
    """
    - input is a ndarray
    - bits is the array representing the bits to extract
    - input_size is the size (in bits) of the input word
    """
    if verb:
        print(input.shape)
        print(input)
        print(f'select_word input : {input}')
        print(f'select_word bits : {bits}')

    return input[bits]

def SBOX(input, sbox):
    """
      - input is a input_size * number_of_inputs binary ndarray
      - sbox is a ndarray representing the SBox
      """
    tmp=np.zeros(shape=(8, input.shape[1]), dtype=np.uint8)
    tmp[-input.shape[0]:] = input
    int_val =  np.packbits(tmp, axis=0)
    int_output=sbox[int_val]
    output=np.unpackbits(int_output, axis=0)
    if verb:
        print("SBox")
        print(input);
        print(int_val);
        print(int_output);
        print(output);
    return output[-input.shape[0]:]

def XOR(input, number_of_inputs, output_bit_size):
    """
    - input is a list of ndarray
    - number_of_inputs is an integer representing the number of values to be xored together
    - input_number_of_words is an integer representing the number of words of each input to the XOR
    """

    #inputConcatenated = [CONCAT([input[i*input_number_of_words + j] for j in range(input_number_of_words)]) for i in range(number_of_inputs)]
    if len(input)!=number_of_inputs:
        inputConcatenated = CONCAT([input[i] for i in range(len(input))])
        output = copy(inputConcatenated[0:output_bit_size])
        for i in range(1, number_of_inputs):
            output ^= inputConcatenated[i*output_bit_size:(i+1)*output_bit_size]
    else:
        numCols = [input[i].shape[1] for i in range(len(input))]
        maxCols = np.max(numCols)
        output=0
        for i in range(number_of_inputs):
            if (input[i].shape[1] == maxCols):
                output^=input[i]
            else:
                output ^= np.broadcast_to(input[i], (input[i].shape[0], maxCols))
    if verb:
        print("XOR:")
        print([input[i].transpose() for i in range(len(input))])
        print([inputConcatenated[i].transpose() for i in range(len(inputConcatenated))])
        print(" Output:")
        print(output.transpose())
    return output

def CONCAT(input):
    """
    - input is a list of ndarray
    """
    #print([input[i].transpose() for i in range(len(input))])

    #for i in input:
    #    print(i.shape)
    numCols=[input[i].shape[1] for i in range(len(input))]
    maxCols=np.max(numCols)
    if (input[0].shape[1]==maxCols):
        output = copy(input[0])
    else:
        output = np.broadcast_to(input[0], (input[0].shape[0], maxCols))
    for i in range(1, len(input)):
        if input[i].shape[1] == maxCols:
            output = np.vstack((output, input[i]))
        else:
            output = np.vstack((output, np.broadcast_to(input[i], (input[i].shape[0], maxCols))))
    if verb:
        print("CONCAT:")
        print([input[i].transpose() for i in range(len(input))])
        print(" Output:")

        print(output.transpose())
    return output


def AND(input, number_of_inputs, output_bit_size):
    """
    - input is a list of ndarray
    - number_of_inputs is an integer representing the number of values to be ANDed together
    - output_bit_size is an integer representing the bit size of the output
    """

    inputConcatenated = CONCAT([input[i] for i in range(len(input))])
    output = copy(inputConcatenated[0:output_bit_size])
    for i in range(1, number_of_inputs):
        output &= inputConcatenated[i*output_bit_size:(i+1)*output_bit_size]
    if verb:
        print("AND:")
        print([input[i].transpose() for i in range(len(input))])
        print([inputConcatenated[i].transpose() for i in range(len(inputConcatenated))])
        print(" Output:")
        print(output.transpose())
    return output

def OR(input, number_of_inputs, output_bit_size):
    """
    - input is a list of ndarray
    """
    if len(input)!=number_of_inputs:
        inputConcatenated = CONCAT([input[i] for i in range(len(input))])
        output = copy(inputConcatenated[0:output_bit_size])
        for i in range(1, number_of_inputs):
            output |= inputConcatenated[i*output_bit_size:(i+1)*output_bit_size]
    else:
        numCols = [input[i].shape[1] for i in range(len(input))]
        maxCols = np.max(numCols)
        output=0
        for i in range(number_of_inputs):
            if (input[i].shape[1] == maxCols):
                output |= input[i]
            else:
                output |= np.broadcast_to(input[i], (input[i].shape[0], maxCols))
    if verb:
        print("OR:")
        print([input[i].transpose() for i in range(len(input))])
        print(" Output:")
        print(output.transpose())
    return output


