def MODADD(input):
    """
       - input is a list of ndarrays
       """
    carry=0
    input0=input[0]
    input1=input[1]
    output=np.zeros(max(input0.shape, input1.shape), dtype=np.uint8)
    word_size=np.shape(input0)[0]
    for i in range(word_size):
        pos=word_size-1-i
        output[pos]=input0[pos]^input1[pos]^carry
        carry=(input0[pos] & input1[pos]) | (input0[pos] & carry) | (input1[pos] & carry)

    if verb:
        print("MODADD:")
        print([input[i].transpose() for i in range(len(input))])
        print(" Output:")
        print(output.transpose())
    return output

