def ROTATE(input, rotation_amount):
    """
    If rotation_amount is negative rotation happens to the left,
    to the right otherwise.

    INPUT:

    - ``input`` -- a ndarray
    - ``rotation_amount`` -- an integer indicating the amount of the rotation, positive for right rotation, negative for left rotation.
    - word_size is an integer
    """
    output=np.roll(input, rotation_amount, axis=0)
    if verb:
        print("ROTATE:")
        print("  r   = {}".format(rotation_amount))
        print(input.transpose())
        print(output.transpose())
        print(input.shape)

    return output

def SHIFT(input, shift_amount):
    """
    If rotation_amount is negative rotation happens to the left,
    to the right otherwise.

    INPUT:

    - ``input`` -- a ndarray
    - ``rotation_amount`` -- an integer indicating the amount of the rotation, positive for right rotation, negative for left rotation.
    - word_size is an integer
    """
    output=np.roll(input, shift_amount, axis=0)
    if shift_amount<0:
        output[shift_amount:,:]=0
    else:
        output[:shift_amount,:]=0
    if verb:
        print("ROTATE:")
        print("  r   = {}".format(shift_amount))
        print(input.transpose())
        print(output.transpose())
    return output

def linear_layer(input, matrix):
    """

    INPUT:

    - ``input`` -- a ndarray
    - ``matrix`` -- a list of lists of 0s and 1s. len(matrix) should be equal to input.len

    """
    output=input.transpose().dot(matrix).transpose() % 2
    if verb:
        print("LINEAR LAYER:")
        print(input)
        print(output)
    return output


def mix_column(input, matrix, mul_table, input_size):
    """

    INPUT:

    - ``input`` -- a ndarray
    - ``matrix`` -- a list of lists of 0s and 1s. len(matrix) should be equal to input.len
    - ``mul_tables`` -- a dictionary giving the multiplication table by x at key x
    - ``input_size`` -- an integer giving the bit size of the words

    """
    output=np.zeros(input.shape, dtype=np.uint8)
    num_words=input.shape[0]//input_size
    outputInt=np.zeros((num_words, input.shape[1]), dtype=np.uint8)
    words = [input[i * input_size : (i+1) * input_size] for i in range(num_words)]
    words_int=[0 for i in range(num_words)]
    for i in [*mul_table]:
        mul_table[i]=np.array(mul_table[i], dtype=np.uint8)
    for i in range(num_words):
        zeros = np.zeros(shape=(8, words[i].shape[1]), dtype=np.uint8)
        zeros[-words[i].shape[0]:] = words[i]
        words_int[i] = np.packbits(zeros, axis=0)
    for i in range(len(matrix)):
        for j in range(len(matrix[0])):
            outputInt[i] ^= mul_table[matrix[i][j]][words_int[j]][0]

    #output = np.unpackbits(outputInt, axis=0)
    output=np.concatenate(np.swapaxes(np.array([(outputInt>> (input_size-i-1))&1 for i in range(input_size)], dtype=np.uint8), 0,1 ))
    outputTmp = [ np.unpackbits(outputInt[i], axis=0) for i in range(num_words)]

    if verb:
        print("MIXCOLUMN:")
        print(input)
        print(output)
    return output
