def generate_avalanche_dataset(num_samples):
    key = np.zeros((128, num_samples), dtype=np.uint8)
    pt = np.random.randint(2, size=(128, num_samples), dtype=np.uint8)
    diff=np.zeros((128, 1), dtype=np.uint8)
    diff[-1]=1
    data=[np.zeros((num_samples, 16384), dtype=np.uint8) for i in range(32)]
    base=evaluate([key, pt])
    for i in range(128):
        input=[key, pt^diff]
        result=evaluate(input)
        for j in range(32):
            data[j][:, i*128:(i+1)*128]=result[j]^base[j]
        diff=np.roll(diff, -1, axis=0)
    return data

def check_test_vector():
    key = [0x19, 0x18, 0x11, 0x10, 0x09, 0x08, 0x01, 0x00, 0x19, 0x18, 0x11, 0x10, 0x09, 0x08, 0x01, 0x00]
    pt = [0x65, 0x74, 0x69, 0x4c, 0x65, 0x74, 0x69, 0x4c, 0x65, 0x74, 0x69, 0x4c, 0x65, 0x74, 0x69, 0x4c]
    ct = [0x63, 0x3a, 0x8c, 0x28, 0x58, 0x5c, 0x7d, 0x27, 0xf2, 0x27, 0x8e, 0x2a, 0x01, 0x16, 0x59, 0x2c]

    key = np.unpackbits(np.array(key, dtype=np.uint8))
    pt = np.unpackbits(np.array(pt, dtype=np.uint8))
    ct = np.unpackbits(np.array(ct, dtype=np.uint8))

    result = evaluate([key.reshape((128, 1)), pt.reshape((128, 1))])
    if ((result[31][0] == ct).all()):
        print("Test Vector Verified")
        return True
    else:
        print("Test Vector NOT Verified")
        return False
